def calculate_alternating_sum(n, a):
    mod = 998244354

    def l(x):
        if x == 0:
            return 0
        return 1 + l(x // 10)
    lens = [0] * 15
    for x in a:
        lens[l(x)] += 1

    def space_out(x, l):
        ans = []
        for (i, c) in enumerate(reversed(str(x))):
            ans.append(c)
            if i < l:
                ans.append('0')
        return int(''.join(reversed(ans)))
    ans = 0
    for i in range(n):
        x = a[i]
        cur_head = x // 10
        cur = x
        prev = x
        for l in range(11):
            if l > 0:
                ans += lens[l] * (cur + 10 * prev)
                ans %= mod
            prev = cur
            cur -= cur_head * 10 ** (2 * l + 1)
            cur += cur_head * 10 ** (2 * l + 2)
            cur_head //= 10
    return ans

